<script>
import moment from "moment";
import StaffService from "@/service/hrService";
import NftService from "@/service/NftService";

import { MediaQueryProvider } from "vue-component-media-queries";
import { MatchMedia } from "vue-component-media-queries";
const queries = {
  mobile: "(max-width: 760px)",
  desktop: "(min-width: 761px)",
};
export default {
  name: "app",
  queries,
  data() {
    return {
      user: {},
      auth: {},
      nhanvien: false,
      quanly: false,
      nhansu: false,
      lanhdao: false,
      list: [],
      listbirthdays: [],
      staffErorr: [],
      listNew: [],
      listOld: [],
      userData: {},
      isLoad: false
    };
  },
  components: {
    MediaQueryProvider,
    MatchMedia,
  },
  computed: {
    loggedIn() {
      return this.$store.state.auth.status.loggedIn;
    },
  },
  watch: {
    loggedIn(value) {
      if (value) {
        this.getDataHeader();
      }
    },
  },
  methods: {
    getLoad(){
      this.isLoad=true;
    },
    getNft(){
      NftService.getNew()
      .then((response) => {
          this.listNew = response.data;

        })
        NftService.getOld()
      .then((response) => {
          this.listOld = response.data;
        })
    },
    getSeen(){
      NftService.Seen().then((response) => {
        console.log(response)

        this.getNft()
      this.isLoad = false
        })
      
      // .then((response) => {
      //     console.log(response)
      //     this.getNft();
      //   })
    },
    logOut() {
      this.$store.dispatch("auth/logout");
      this.$router.push("/");
      location.reload(true);
    },
    formatDate(value) {
      if (value) {
        return moment(String(value)).format("DD/MM/yyyy");
      }
    },
    getAll() {
      StaffService.getRegisterWelfare()
        .then((response) => {
          this.list = response.data;
        })
        .catch((e) => {
          console.log(e);
        });
    },
    getBD() {
      StaffService.getBirthdays()
        .then((response) => {
          this.listbirthdays = response.data;
        })
        .catch((e) => {
          console.log(e);
        });
    },
    userExists(name) {
      return this.auth.some(function (el) {
        return el.name === name;
      });
    },
    async getUser() {
      const response = await StaffService.getUser();
      if (response.status == 200) {
        this.user = response.data;
        this.auth = this.user.roles;
        if (this.userExists("ROLE_USER")) {
          this.nhanvien = true;
        }
        if (this.userExists("ROLE_ADMIN")) {
          this.quanly = true;
        }
        if (this.userExists("ROLE_PERSONNEL")) {
          this.nhansu = true;
        }
        if (this.userExists("ROLE_MODERATOR")) {
          this.lanhdao = true;
        }
      }
    },
    getDataHeader() {
      if (!this.loggedIn) return;
      this.getUser();
      this.getAll();
      this.getBD();
      this.getErorr();
    },
    getErorr() {
      StaffService.getErorr().then((response) => {
        this.staffErorr = response.data;
      });
    },
  },
  created() {
    this.getDataHeader();
    this.getNft();
    StaffService.getUser()
        .then((response) => {
          this.userData = response.data;
        })
        var d1 = new Date(); //"now"
        var d2 = new Date("2022/12/13");  // some date
        var diff = Math.abs(d1-d2);
        var time = diff/86400000
        console.log(Math.round(time))    
  }

};
</script>
  
